  false,\n\t\"url\": null,\n\t\"notes\": \"IBCAO Version 3.0 represents the largest
  improvement since 1999 taking advantage of new data sets collected by the circum-Arctic
  nations, opportunistic data collected from fishing vessels, data acquired from US
  Navy submarines and from research ships of various nations. Built using an improved
  gridding algorithm, this new grid is on a 500 meter spacing, revealing much greater
  details of the Arctic seafloor than IBCAO Version 1.0 (2.5 km) and Version 2.0 (2.0
  km). The area covered by multibeam surveys has increased from ~6 % in Version 2.0
  to ~11% in Version 3.0.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
